ownerLogin":"gokul-chandrasekar","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2023-07-10T21:59:21.000+05:30","ownerAvatar":"https://avatars.githubusercontent.com/u/113445140?v=4","public":true,"private":false,"isOrgOwned":false},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"main","listCacheKey":"v0:1691938061.0","canEdit":true,"refType":"branch","currentOid":"8903211aceb994e588d3984da88f6a675bda04fb"},"path":"R lab programs/Ex 39.Population dataset.R","currentUser":{"id":100275995,"login":"sakthivelg007","userEmail":"svel56937@gmail.com"},"blob":{"rawLines":["# Load the USArrests dataset\r","data(\"USArrests\")\r","\r","# (i) (a) Explore the summary of the dataset\r","summary_data <- summary(USArrests)\r","print(summary_data)\r","\r","# (i) (b) Print the state which saw the largest total number of rape\r","state_max_rape <- rownames(USArrests)[which.max(USArrests$Rape)]\r","print(paste(\"State with the largest total number of rape:\", state_max_rape))\r","\r","# (i) (c) Print the states with max & min crime rates for murder\r","state_max_murder <- rownames(USArrests)[which.max(USArrests$Murder)]\r","state_min_murder <- rownames(USArrests)[which.min(USArrests$Murder)]\r","print(paste(\"State with the highest crime rate for murder:\", state_max_murder))\r","print(paste(\"State with the lowest crime rate for murder:\", state_min_murder))\r","\r","# (ii) (a) Find the correlation among the features\r","correlation_matrix <- cor(USArrests)\r","print(correlation_matrix)\r","\r","# (ii) (b) Print the states which have assault arrests more than median of the country\r","median_assault <- median(USArrests$Assault)\r","states_above_median_assault <- rownames(USArrests)[USArrests$Assault > median_assault]\r","print(paste(\"States with assault arrests more than median:\", states_above_median_assault))\r","\r","# (ii) (c) Print the states in the bottom 25% of murder\r","bottom_25_murder <- quantile(USArrests$Murder, probs = 0.25)\r","states_bottom_25_murder <- rownames(USArrests)[USArrests$Murder < bottom_25_murder]\r","print(paste(\"States in the bottom 25% of murder:\", states_bottom_25_murder))\r","\r","# (iii) (a) Create a histogram and density plot of murder arrests\r","hist_density_murder <- ggplot(USArrests, aes(x = Murder)) +\r","  geom_histogram(binwidth = 2, fill = \"skyblue\", color = \"black\") +\r","  geom_density(aes(y = ..scaled..), fill = \"red\", alpha = 0.3) +\r","  labs(title = \"Histogram and Density Plot of Murder Arrests\",\r","       x = \"Murder Arrests\",\r","       y = \"Density\")\r","\r","# (iii) (b) Create a scatter plot with assault and murder arrests\r","scatter_plot <- ggplot(USArrests, aes(x = Murder, y = UrbanPop, color = Assault)) +\r","  geom_point() +\r","  labs(title = \"Relationship between Murder Arrest Rate, Urban Population, and Assault Arrest Rate\",\r","       x = \"Murder Arrests\",\r","       y = \"Urban Population\",\r","       color = \"Assault Arrests\")\r","\r","# (iii) (c) Create a bar graph to show the murder rate for each state\r","barplot_murder_rate <- ggplot(USArrests, aes(x = reorder(rownames(USArrests), -Murder), y = Murder)) +\r","  geom_bar(stat = \"identity\", fill = \"skyblue\") +\r","  coord_flip() +\r","  labs(title = \"Murder Rate by State\",\r","       x = \"State\",\r","       y = \"Murder Rate\")\r","\r","# Display the plots\r","print(hist_density_murder)\r","print(scatter_plot)\r","print(barplot_murder_rate)\r"],"stylingDirectives":[[{"start":0,"end":28,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":5,"end":16,"cssClass":"pl-s"},{"start":5,"end":6,"cssClass":"pl-pds"},{"start":15,"end":16,"cssClass":"pl-pds"}],[],[{"start":0,"end":44,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":12,"cssClass":"pl-smi"},{"start":13,"end":15,"cssClass":"pl-k"},{"start":24,"end":33,"cssClass":"pl-smi"}],[{"start":6,"end":18,"cssClass":"pl-smi"}],[],[{"start":0,"end":68,"cssClass":"pl-c"},{"start":0,"